@import '@/assets/styles/sprite-home.scss';
@import '@/assets/styles/sprite-001.scss';

:deep(.nav-bar) {
  .van-nav-bar__title {
    overflow: visible;
  }
  .van-nav-bar__right {
    bottom: unset !important;
    top: 50%;
    transform: translate3d(0px, -50%, 0px);
  }
}

:deep(.title_buy_top) {
  font-size: 18px;
  padding: 0 15px;
  background: #004b6b;
  transform-origin: 0 0;
  height: calc(1 / var(--scale-factor) * 30px);
  display: flex;
  align-items: center;
  justify-content: center;
}

.title_left {
  border-radius: 5px 0 0 5px;
}

.title_right {
  border-radius: 0 5px 5px 0;
}

.active {
  font-size: 19px;
  font-weight: 700;
  background: #fff;
  color: var(--van-button-primary-background);
  border-radius: 5px;
}

.copy-white {
  filter: grayscale(100%) brightness(130%);
}

.active.title_left {
  position: relative;
  right: -8px;
}

.blue-bg {
  width: 100%;
  height: 30px;
  background-color: var(--van-button-primary-background);
}

.home-container {
  position: relative;
  width: 100%;
  height: calc(100% - 30px);
  margin-top: -30px;
  background-color: #ebf1f6;
  overflow: hidden;

  &.wide {
    margin-top: 0;
  }

  .topbar-container {
    width: 100%;
    height: 264px;
    flex: 0 0 264px;
    padding: 0 30px;
    box-sizing: border-box;
    background-color: var(--van-button-primary-background);

    .topbar-content-view {
      position: relative;
      width: 100%;
      height: 90px;

      .top-icon-bg {
        display: flex;
        align-items: center;
        justify-content: space-between;
        width: 132px;
        height: 50px;
        padding: 0 19px;
        background: v-bind('topIconBg') no-repeat center / cover;
      }

      .logo-container {
        position: absolute;
        top: 48px;
        left: 50%;
        transform: translate3d(-50%, 0, 0);
        display: flex;
        justify-content: space-between;
        align-items: center;

        .home-top-logo {
          width: 45px;
        }

        .text-logo {
          margin-left: 10px;
          font-size: 42px;
          color: #fff;
        }
      }

      .help {
        margin: 0 28px;
      }

      .message {
        position: relative;
        margin-bottom: -3px;
        margin-right: auto;
      }

      .unread-sign {
        position: absolute;
        top: -7px;
        right: -9px;
        width: 24px;
        height: 24px;
        line-height: 24px;
        background-color: red;
        color: #fff;
        font-size: 14px;
        text-align: center;
        border-radius: 50%;
      }
    }
  }

  .main-content-container {
    flex: 1;
    width: 100%;
    padding: 0 20px;

    .wallet-info-container {
      position: relative;
      width: 100%;
      z-index: 1;

      .wallet-info {
        width: 100%;
        // margin-top: -140px;
        border-radius: 14px;
        background-color: #fff;

        .wallet-main-content {
          padding: 21px;
          font-size: 26px;
          color: #868d9a;

          .text-funding-details {
            color: var(--van-button-primary-background);
          }
        }
      }
    }
  }

  .go-banzhuan {
    position: absolute;
    right: 0;
    top: 356px;
    width: 198px;
    height: 52px;
    padding: 10px 0 12px 22px;
    color: #fff;
    background-color: #fea703;
    font-size: 25px;
    border-top-left-radius: 26px;
    border-bottom-left-radius: 26px;
    white-space: nowrap;

    img {
      width: 31px;
      height: 31px;
      margin-right: 7px;
    }

    .process-order-sign {
      position: absolute;
      top: -7px;
      right: 6px;
      width: 35px;
      height: 35px;
      line-height: 35px;
      background-color: #d9001c;
      color: #fff;
      font-size: 21px;
      text-align: center;
      border-radius: 50%;
    }
  }

  :deep(.dialog-open-notice) {
    width: 708px;
    height: auto;
    padding: 40px;

    &.dialog-open-notice-wide-mode {
      width: 530px;
      padding: 20px;
      overflow-y: auto;
      display: flex;
      flex-direction: column;
      justify-content: space-between;

      .van-dialog__header {
        font-size: 20px;
        line-height: unset;
      }

      .van-dialog__content {
        max-height: unset;
        margin: 15px 0 15px 0;
        flex: 1;
      }

      .dialog-content {
        // height: 100px;
        font-size: 16px;
      }

      .btn-confirm {
        height: 40px;
        font-size: 16px;
      }

      .dialog-radio-controler {
        margin-top: 10px;
      }

      .radio-uncheck {
        width: 18px !important;
        height: 18px !important;
      }

      .radio-checked {
        $scale: calc(18 / 35);
        background: url($spriteHome) calc(-0px * $sprite-computed-factor * $scale)
          calc(-282px * $sprite-computed-factor * $scale) no-repeat;
        width: 18px;
        height: 18px;
        background-size: calc(108px * (7 / 10) * $scale) calc(730px * (7 / 10) * $scale);
      }

      .radio-text {
        font-size: 12px !important;
      }
    }

    .van-dialog__header {
      padding: 0;
      font-size: 29px;
      color: #13161b;
    }

    .van-dialog__content {
      max-height: 600px;
      margin: 33px 0 35px 0;
      font-size: 25px;
      color: #787f8c;
      text-align: justify;
      overflow-y: auto;
    }

    .dialog-content {
      img {
        width: 100%;

        &[alt*='['] {
          width: auto;
        }
      }

      p {
        margin-bottom: 10px;
      }
    }

    .van-dialog__footer {
      padding: 0;
    }

    .van-dialog__confirm,
    .btn-confirm {
      width: 100%;
      height: 80px;
      font-size: 31px;
      background: var(--van-button-primary-background);
      color: #fff;
      border: 0;
      border-radius: 8px;
    }

    .dialog-radio-controler {
      margin-top: 20px;

      .radio {
        margin-right: 10px;
      }

      .radio-uncheck {
        width: 35px;
        height: 35px;
        border: 1px solid #868d9a;
        border-radius: 50%;
      }

      .radio-text {
        font-size: 25px;
        color: #13161b;
      }
    }

    .icon-close {
      position: absolute;
      right: 40px;
      top: 24px;
    }

    img {
      width: 100%;
      margin-top: 20px;
    }

    &.dialog-bg-img {
      padding: 0;

      .van-dialog__content {
        height: 572px;
        max-height: 600px;
        margin: 0;
        background: v-bind('dialogBgImg') no-repeat center / cover;
        overflow-y: auto;
      }

      .van-dialog__confirm {
        margin: 0 40px 40px 40px;
      }

      .btn-confirm {
        width: 626px;
        margin: 0 auto;
        margin-top: 30px;
      }

      .dialog-radio-controler {
        margin: 20px auto;
      }
    }
  }
}
